import React, { useState } from "react";
import "./All.css"
import icon from "../Resimler/Süperlig_logo.png"
import { Link } from "react-router-dom";
import axios from "axios";




const Kayıtol = () => {

    const data ={name:"",email:""};
    const [kayit,setKayitol] = useState(data)


    axios.post("https://cryptic-gorge-72989.herokuapp.com/users",kayit)
    .then(response=>{
        console.log(response)
    })




    return (
        <div>
            <div className="Profil-cercevesi">
                <div className="Profil-cerceve-ici">
                    <div className="orta">
                        <img src={icon} width="70" />
                    </div><br />
                    <div class="form-floating mb-3">
                        <input type="email" class="form-control" id="floatingInput" placeholder="Kullanıcı Adı" />
                        <label for="floatingInput">
                            <i class="fa-solid fa-user fa-beat-fade"></i> Kullanıcı Adı
                        </label>
                    </div>
                    <div class="form-floating">
                        <input type="email" class="form-control" id="floatingPassword" placeholder="Password" />
                        <label for="floatingPassword">
                        <i class="fa-solid fa-envelope fa-beat-fade"></i> E-Mail
                        </label>
                    </div><br />
                    <Link to={"/"}><p><button className="button-genisligi btn btn-light">Kayıt Ol</button></p></Link>



                </div>

            </div>
        </div>
    )
}

export default Kayıtol;
